from typing import List


class Solution:
    def trap(self, height: List[int]) -> int:
        max_value = max(height)
        min_value = min(height)
        if max_value == min_value:
            return 0
        max_index= height.index(max_value)
        def dfs(nums, i,j, position):
            if j-i <2:
                return 0
            second_max = max(nums[i:j])
            if position == 'left':
                second_max_index = nums[i:j].index(second_max)
                a= sum([second_max - value for value in nums[second_max_index+ 1:j ]])

                if second_max_index <2:
                    return a

                return a+ dfs(nums,i,second_max_index,  'left')

            if position == 'right':

                for k in range(j-1, -1, -1):
                    if nums[k] == second_max:
                        second_max_index = k
                        break
                # print(i, j, nums[i:j], second_max, second_max_index)
                b = sum([second_max - value for value in nums[i:second_max_index]])
                # print(b, second_max_index, j-i , second_max_index > j-i-2)
                if  second_max_index > len(nums)-2:
                    return b
                # print("+++++",second_max_index+1,j, nums[second_max_index+1:j])
                return b+ dfs(nums,second_max_index+1,j,  'right')
            return 0
        a=dfs(height,0, max_index  ,'left')
        b=dfs(height, max_index+1,len(height), 'right')
        # print(a,b,max_index)
        return a+b



